 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Les exercices de s\u00e9lection par choix sont des textes o\u00f9 les apprenants doivent s\u00e9lectionner les expressions correctes. Ils sont souvent utilis\u00e9s quand les objectifs sont: <\/p><ol><li>Pour v\u00e9rifier les connaissances sur les contenus du cours (l'exercice peut \u00eatre d'\u00e9valuation initiale, formative ou finale). <\/li><li>Pour v\u00e9rifier les connaissances lexicales. <\/li><li>Pour v\u00e9rifier la formation d'un mot et\/ou une comp\u00e9tence grammaticale. <\/li><\/ol>", 
