 "Enter an RSS URL for the RSS feed you \nwant to attach to your content. Feeds are often identified by a small graphic\n icon (often like this <img src=\"\/images\/feed-icon.png\" \/>) or the text \"RSS\". Clicking on the \n icon or text label will display an RSS feed right in your browser. You can copy and paste the\nURL into this field. Alternately, right clicking on the link or graphic will open a menu box;\nclick on COPY LINK LOCATION or Copy Shortcut. Back in eXe open the RSS bookmark iDevice and Paste the URL \ninto the RSS URL field and click the LOAD button. This will extract the titles from your feed and\ndisplay them as links in your content. From here you can edit the bookmarks and add\n instructions or additional learning information.": "Entrez l'adresse URL du flux RSS que vous souhaitez associer au contenu.Les flux RSS sont souvent identifi\u00e9s par une petite ic\u00f4ne graphique (souvent comme cette image <img src=\"\/images\/feed-icon.png\"\/> ou par le texte \"RSS\". En cliquant sur l'ic\u00f4ne ou sur le texte vous ferez appara\u00eetre correctement le flux RSS dans votre navigateur.Vous pouvez copier-coller l'adresse URL dans ce champ. D'une autre mani\u00e8re, en faisant un clic droit sur le lien ou l'ic\u00f4ne vous ouvrez une boite de menu ; cliquez sur COPY LINK LOCATION ou copiez le raccourci. Dans l'interface d'Exe, ouvrez l'outil p\u00e9dagogique signet RSS, copiez l'adresse URL dans le champ URL RSS et cliquer sur le bouton T\u00e9l\u00e9charger. Ceci vous permettra d'extraire les titres de votre flux RSS et de les afficher comme liens dans votre contenu. Vous pouvez ainsi \u00e9diter vos signets et ajouter des consignes ou des informations compl\u00e9mentaires d'apprentissage.", 
