 "yes": "oui", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl> <dt> Si votre but est de tester la compr\u00e9hension des concepts de base ou encore l'interpr\u00e9tation suite \u00e0 la lecture: <\/dt> <dd> <p> R\u00e9digez un r\u00e9sum\u00e9 du concept ou du texte \u00e0 lire, suffisamment long pour tester de mani\u00e8re ad\u00e9quate l'objectif de connaissance cible \u00e0 atteindre mais pas trop non plus pour ne pas d\u00e9courager. Une page de caract\u00e8res maximum para\u00eet \u00eatre la solution ad\u00e9quate et probablement moins encore pour les jeunes apprenants et les d\u00e9butants.<\/p> <p> S\u00e9lectionnez des mots-clefs de compr\u00e9hension des concepts au sein du texte.Ce seront probablement des verbes, adverbes ou des propositions nominales. Proposez plusieurs alternatives, dont une sera la r\u00e9ponse claire et sans appel.<\/p> <\/dd> <dt> Si votre but est de tester la connaissance du vocabulaire: <\/dt> <dd> <p> R\u00e9digez un texte en utilisant le vocabulaire cible. Ce texte devra \u00eatre coh\u00e9rent, concis et d'une longueur appropri\u00e9e. Surlignez les mots-cibles dans le texte. Proposez plusieurs alternatives, o\u00f9 la r\u00e9ponse correcte sera claire et sans appel. Si votre but est de tester les capacit\u00e9s grammaticales ou syntaxiques de l'apprenant:<\/dt> <dd> <p> R\u00e9digez un texte comprenant les formes grammaticales ou syntaxiques en question. Ce texte devra \u00eatre coh\u00e9rent, concis et d'une longueur appropri\u00e9e. N'oubliez pas que le but ici n'est pas la connaissance du vocabulaire, la compr\u00e9hension basique du radical des mots \u00e9tant suppos\u00e9e acquise par les apprenants.<\/p> <p> Surlignez les mots-cibles au sein du texte. Faites des propositions alternatives \u00e0 partir du m\u00eame mot-radical, mais avec diff\u00e9rents suffixes. Il peut \u00eatre int\u00e9ressant de proposer le test \u00e0 un coll\u00e8gue pour s'assurer de la validit\u00e9 du dit-test et donc \u00e9viter les mauvaises surprises! <\/p> <\/dd> <\/dl> ", 
