 "Include Single Page export file?": "Ajouter le dossier d'exportation en une seule page?", 
 "<p>Teachers should keep the following in mind when using this iDevice: <\/p><ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p> Les formateurs utilisant cet outil p\u00e9dagogique doivent garder ce qui suit \u00e0 l'esprit: <\/p> <ol><li> Pensez au nombre d'activit\u00e9s de diff\u00e9rentes sortes que vous envisagez de cr\u00e9er \u00e0 l'aide de votre ressource et qui seront visualisables au sein du m\u00eame document. Evitez d'en cr\u00e9er de trop nombreuses \u00e0 l'aide de la m\u00eame ressource, ce qui pourrait entrainer des confusions chez les apprenants. En g\u00e9n\u00e9ral, 3 ou 4 diff\u00e9rentes activit\u00e9s sont un maximum \u00e0 partir d'une m\u00eame ressource p\u00e9dagogique.<\/li> <li> D'un point de vue esth\u00e9tique, \u00e9vitez d'utiliser 2 outils p\u00e9dagogiques \u00e0 la suite sans un texte les s\u00e9parant. Si n\u00e9cessaire, il vaut mieux \u00e0 l'aide du m\u00eame outil ajouter une question ou un \u00e9v\u00e8nement suppl\u00e9mentaire.<\/li> <li> Pensez aux activit\u00e9s o\u00f9 le b\u00e9n\u00e9fice que peut en retirer l'apprenant prime sur le temps et l'effort qu'il mettra \u00e0 les r\u00e9aliser.<\/li> <\/ol>", 
