 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "Bien qu'ils soient le plus souvent utilis\u00e9s en situation d'\u00e9valuation formative, les QCM peuvent \u00e9galement \u00eatre des outils de stimulation de la pens\u00e9e et d'entr\u00e9e de discussion sur des sujets pour lesquels les apprenants peuvent avoir quelques appr\u00e9hensions de prime abord.\n \n Lorsque vous voulez cr\u00e9er un test QCM, posez-vous les questions suivantes :\n <ul> \n <li> Quels r\u00e9sultats en terme d'apprentissage sont inh\u00e9rents aux choix op\u00e9r\u00e9s ?<\/li> \n <li> Quelles comp\u00e9tences intellectuelles sont ainsi mises \u00e0 l'\u00e9preuve ? <\/li> \n <li> Quelles sont les comp\u00e9tences linguistiques du public cible ?<\/li> \n <li> Quels sont les biais possibles li\u00e9s aux contextes de culture ou de genre par exemple ?<\/li> \n <\/ul> \n ", 
