 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>\tWhat educational points are conveyed in the story<\/li>\n<li>\tWhat preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>\tWhere the case study fits into the rest of the course<\/li>\n<li>\tHow the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "L'outil \"cas d'\u00e9tude\" permet des apprentissages par simulation. A partir de situations g\u00e9n\u00e9ralement puis\u00e9es dans la r\u00e9alit\u00e9, les apprenants doivent d\u00e9montrer ou d\u00e9crire par quelles actions ils peuvent r\u00e9aliser la t\u00e2che appropri\u00e9e ou r\u00e9soudre le probl\u00e8me pos\u00e9. L'outil \"cas d'\u00e9tude\" permet aux apprenants d'utiliser leurs propres savoir et exp\u00e9rience afin de r\u00e9aliser les t\u00e2ches demand\u00e9es. <ul>\n <li> Lorsque vous utilisez cet outil \"cas d'\u00e9tude\", demandez-vous:<ul> \n <li> Quels \u00e9l\u00e9ments d'apprentissage sont transmis par le sujet?<\/li> <li> Quel travail pr\u00e9alable l'apprenant doit-il r\u00e9aliser avant de s'attaquer au \"cas d'\u00e9tude\"?<\/li> \n <li> O\u00f9 doit \u00eatre plac\u00e9 ce cas d'\u00e9tude dans le cours?<\/li> \n <li> Comment les apprenants pourront-ils interagir avec le mat\u00e9riel propos\u00e9, de m\u00eame qu'entre eux (par exemple au sein d'une classe)? Comment les groupes peuvent-ils travailler sur les diff\u00e9rents aspects de la situation? Comment se r\u00e9alise la mise en commun?<\/li><\/ul>", 
