 "<p>The reading activity, as the name \nsuggests, should ask the learner to perform some form of activity. This activity \nshould be directly related to the text the learner has been asked to read. \nFeedback to the activity where appropriate, can provide the learner with some \nreflective guidance.<\/p>": "<p> L'outil \"Lecture\", comme le sugg\u00e8re son nom, demande \u00e0 l'apprenant de r\u00e9aliser une certaine activit\u00e9. Celle-ci peut \u00eatre directement li\u00e9e au texte qu'il lui a \u00e9t\u00e9 demand\u00e9 de lire.L'\"\u00e9cho\" sur l'activit\u00e9 lorsqu'il est opportun peut fournir des rep\u00e8res \u00e0 l'apprenant sur la fa\u00e7on de proc\u00e9der.<\/p> ", 
