 "Bosnian ": "Bosnien", 
 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nL'outil p\u00e9dagogique \"Image et Texte\" peut \u00eatre utilis\u00e9 autant que possible de telle mani\u00e8re \u00e0 conforter les dimensions cognitives et limbiques (\u00e9motionnelles) des t\u00e2ches d'apprentissage au sein des contenus d'eXe\n.\n<\/p> <p>\n<b> Int\u00e9grer des contenus visuels associ\u00e9s \u00e0 des r\u00e9sum\u00e9s textuels<\/b>\n<\/p> <p>\nLes psychologues de la cognition montrent que la pr\u00e9sentation simultan\u00e9e d'un visuel repr\u00e9sentatif et d'un r\u00e9sum\u00e9 textuel lui correspondant permet \u00e0 l'apprenant de r\u00e9duire son effort d'apprentissage et augmente sa capacit\u00e9 de m\u00e9morisation.\nCet outil p\u00e9dagogique permet de pr\u00e9senter un visuel (photographie, diagramme ou graphique)associ\u00e9 \u00e0 un r\u00e9sum\u00e9 textuel explicitant les principaux \u00e9l\u00e9ments r\u00e9f\u00e9rant \u00e0 ce visuel. Par exemple, si vous voulez expliquer le fonctionnement d'un moteur \u00e0 4 temps , vous pourriez utiliser un visuel pour chacune des 4 positions du piston avec un bref r\u00e9sum\u00e9 expliquant les points fondamentaux correspondant \u00e0 chaque position.\n<\/p>", 
 "XML Files": "Fichiers XML", 
 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p> Les exercices du type \"remplir les blancs\" sont des textes ou des phrases au sein desquels les apprenants doivent trouver et remplir les mots manquants. Ils sont souvent utlis\u00e9s dans les cas suivants:<\/p> <ol> <li> Pour valider la connaissance des concepts de base d'un cours (exercice de pr\u00e9-requis, formatif ou certificatif).<\/li> <li> Pour valider la compr\u00e9hension d'un texte.<\/li> <li> Pour valider la connaissance du vocabulaire.<\/li> <li> Pour valider les comp\u00e9tences grammaticales ou syntaxiques.<\/li> <li>", 
