 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitilization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p> Si vous ne cochez pas cette case: un petit nombre d'erreurs de caract\u00e8res ou d'emploi des majuscules sera tol\u00e9r\u00e9. Si vous la cochez, aucune erreur ne sera accept\u00e9e.<\/p> <p> <strong> Par exemple:<\/strong> Si la bonne r\u00e9ponse est: <code>Elephant<\/code> alors <code>elephant<\/code> et <code>Eliphant<\/code> seront admis comme <em>\"assez proche\"<\/em> par l'algorithme, en ce sens qu'il n'y aurait qu'un caract\u00e8re faux, m\u00eame si \"Validation des Majuscules\" est coch\u00e9.<\/p> <p> Si la case \"Validation des Majuscules\" n'est pas coch\u00e9e dans l'exemple ci-dessus, le <code>e<\/code> minuscule ne sera pas consid\u00e9r\u00e9 comme une faute et donc <code>eliphant<\/code> sera \u00e9galement accept\u00e9.<\/p> <p> Si seule la case \"marquage strictement identique\" est coch\u00e9e et si celle de \"Validation des Majuscules\" ne l'est pas: <code>elephant<\/code> sera \u00e9galement accept\u00e9.", 
