 "exercise": "evercice", 
 "When building an MCQ consider the following: <ul>\n<li> Use phrases that learners are familiar with and have \nencountered in their study <\/li>\n<li> Keep responses concise <\/li>\n<li> There should be some consistency between the stem and the responses <\/li>\n<li> Provide enough options to challenge learners to think about their response\n<\/li>\n<li> Try to make sure that correct responses are not more detailed than the \ndistractors <\/li>\n<li> Distractors should be incorrect but plausible <\/li>\n<\/ul>\n": "Lorsque vous cr\u00e9ez un QCM, veillez \u00e0 ce qui suit:<ul>\n<li> Utilisez des phrases famili\u00e8res pour l'apprenant et qu'il a d\u00e9j\u00e0 rencontr\u00e9es dans son parcours.<\/li>\n<li> Proposez des r\u00e9ponses concises.<\/li>\n<li>Faites en sorte qu'il y ait un lien entre la question et les r\u00e9ponses propos\u00e9es.<\/li>\n<li>Donnez suffisamment d'options de r\u00e9ponse de mani\u00e8re \u00e0 susciter chez l'apprenant une r\u00e9flexion sur son choix.<\/li>\n<li>Faites en sorte que les bonnes r\u00e9ponses ne soient pas plus d\u00e9taill\u00e9es que les mauvaises.<\/li>\n<li>Les mauvaises r\u00e9ponses doivent certes \u00eatre incorrectes mais cependant plausibles.<\/li>\n <\/ul>\n", 
