 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU free documentation license.<\/p>": "<p> L'outil p\u00e9dagogique Wikipedia vous permet de localiser un contenu existant au sein de l'encyclop\u00e9die libre Wikipedia et de le t\u00e9l\u00e9charger dans votre document eXe. L'outil vous permet de r\u00e9aliser une copie instantan\u00e9e du contenu de l'article. Les modifications de cet article dans Wikipedia ne seront pas toutefois automatiquement mises \u00e0 jour dans votre document: si vous souhaitez les incorporer, il vous faudra t\u00e9l\u00e9charger \u00e0 nouveau l'article modifi\u00e9. De la m\u00eame mani\u00e8re, les modifications que vous pourriez apporter au contenu de l'article au sein d'eXe ne seront pas mises \u00e0 jour dans Wikipedia.<\/p> <p> Le contenu de Wikipedia est sous licence GNU.<\/p>", 
